import React, { useState } from "react";
import Position from "../components/position";
import "./352style.css";

function Formation352() {
  const players = [
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
    "player11"
  ];

  const [roleToPositionMapping, setRoleToPositionMapping] = useState({
    [players[10]]: "Goalkeeper",
    [players[9]]: "Defender",
    [players[8]]: "Defender",
    [players[7]]: "Defender",
    [players[6]]: "Fullback",
    [players[2]]: "Fullback",
    [players[5]]: "Midfielder",
    [players[4]]: "Midfielder",
    [players[3]]: "Midfielder",
    [players[2]]: "Forward",
    [players[1]]: "Forward"
  });

  const updateRoleToPositionMapping = (playerName, role) => {
    setRoleToPositionMapping(prevMapping => ({
      ...prevMapping,
      [playerName]: role
    }));
  };

  return (
    <div className="formation352">
      <div className="attackLane352">
        <Position playerName={players[0]} positionName="ATTACK" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[1]} positionName="ATTACK" updateRoleToPositionMapping={updateRoleToPositionMapping} />
      </div>
      <div className="midLane352">
        <Position playerName={players[2]} positionName="LAT" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[3]} positionName="MID" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[4]} positionName="MID" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[5]} positionName="MID" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[6]} positionName="LAT" updateRoleToPositionMapping={updateRoleToPositionMapping} />
      </div>
      <div className="backLane352">
        <Position playerName={players[7]} positionName="DEF" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[8]} positionName="DEF" updateRoleToPositionMapping={updateRoleToPositionMapping} />
        <Position playerName={players[9]} positionName="DEF" updateRoleToPositionMapping={updateRoleToPositionMapping} />
      </div>
      <div className="gkLane352">
        <Position playerName={players[10]} positionName="GK" updateRoleToPositionMapping={updateRoleToPositionMapping} />
      </div>
    </div>
  );
}

export default Formation352;
